import React from "react";
import './Menubar.css';
import { Link } from "react-router-dom";
import LinkButton from "./../../Components/LinkButton/LinkButton";
const Menubar = ()=>{

    return(
        <div id="menubar" className="menubar">
                <div className="profilephoto">
                    <div className="head"></div>
                    <div className="body"></div>
                    <img src="" alt=""/>
                </div>
                <label style={{fontWeight:"700",paddingTop:"40px"}}>Account UserName</label>
                <Link style={{width:"100%",textDecoration:"none",paddingTop:"50px",alignItems:"center",justifyContent:"center",display:"flex"}}><LinkButton>Login</LinkButton></Link>                
                <Link style={{width:"100%",textDecoration:"none",paddingTop:"25px",alignItems:"center",justifyContent:"center",display:"flex"}}><LinkButton>Sign up</LinkButton></Link>
        </div>
    );
}
export default Menubar;
